Promotional info for the collected edition - &quot;As each new generation of men must hand down the torch to the next, so each new generation of alien symbiotes must hand down the, ah, stringy, fleshy tendrils. So move over Venom, step aside Carnage, because Toxin is taking the spotlight! When the full-scale jailbreak from the pages of New Avengers leaves New York overrun with super-villains, Pat sees the perfect opportunity to use the creature sharing his body for good. But Toxin might have other ideas! Featuring a special guest appearance by Spider-Man!&quot;

